// src/components/Dashboard.js
import React from 'react';
import { auth } from '../firebase';
import { signOut } from 'firebase/auth';

function Dashboard() {
  const logout = async () => {
    await signOut(auth);
    alert("Logged out");
  };

  return (
    <div>
      <h2>Welcome to Dashboard</h2>
      <button onClick={logout}>Logout</button>
    </div>
  );
}

export default Dashboard;
